style.css:
/*http://userstyles.org/styles/79062/tumblr-portal-icons*/
@namespace url(http://www.w3.org/1999/xhtml);
@-moz-document url-prefix("http://www.tumblr.com"), url-prefix('https://www.tumblr.com')   {

#new_post a[class="new_post_label"] span {
  background-repeat: no-repeat !important;
}
#new_post a[class="new_post_label"] {
  padding-top: 75px !important;
  font-variant: small-caps !important;
  text-transform: lowercase !important;
  font-family: verdana, arial, sans-serif !important;
  font-weight: bold !important;
  color: black !important;
}
#new_post a[class="new_post_label"],
#new_post a[class="new_post_label"] span {
  opacity: .9 !important;
  color: rgba(0,0,0,.65) !important;
}
#new_post a[class="new_post_label"]:hover,
#new_post a[class="new_post_label"] span:hover {
  opacity: 1 !important;
  color: rgba(0,0,0,1) !important;
}

#new_post_label_text .new_post_label_icon {
  background: url("data:image/jpeg;base64,") !important;
}
#new_post_label_photo .new_post_label_icon {
  background: url("data:image/jpeg;base64,") !important;
}
