}
#new_post_label_chat .new_post_label_icon {
  background: url("data:image/jpeg;base64,") !important;
}
#new_post_label_audio .new_post_label_icon {
  background: url("data:image/jpeg;base64,") !important;
}
#new_post_label_video .new_post_label_icon {
